	<script type="text/javascript">
		$(function() {
			var $svg = $('#svg g'),
				$svg_child = $('#svg>g').children();
			var i = 0,
				length = $svg_child.length,
				randomNum= Math.round(Math.random()*20)+10;
			//console.log(length)
			$svg_child.hide();
			var timeUpdate = setInterval(function() {
				if(i === length - 1) {
					clearInterval(timeUpdate);
					return false;
				};
				randomNum= Math.round(Math.random()*30)+50;
				//console.log(randomNum)
				$svg_child.eq(i).show();
				i++;
			}, randomNum);
		});
	</script>
